import Header from "../components/Header";
import React from 'react';


const onSubmit = async (form_data) => {
    try {
        const { data } = await axios({
            method: 'post',
            url: 'http://localhost:8080/api/v1/users/saveUser',
            data: form_data
        });
        console.log(data.meta.status);

        if (!data?.meta?.status) {
            console.log("stage 1 error");
            setApiError(data?.meta?.status_message);
        } else {
            setPhone(form_data.phone);
            console.log(form_data.phone);
            setStep("stage2");
        }


    }
    catch (err) {
        setApiError('Some error occured during registration');
        //  console.log('Some error occured during signing in: ', err);
    }
};
function Register(){
    return(
        <React.Fragment>
           <Header />
        <div class="container">
        <div class="box form-box">
        <header>Sign Up</header>
        <form onSubmit={handleSubmit(onSubmit)}>
                <div class="field input">
                    <label for="username">Username</label>
                    <input type="text" name="username" id="username" autocomplete="off" required></input>
                </div>

                <div class="field input">
                    <label for="email">Email</label>
                    <input type="text" name="email" id="email" autocomplete="off" required></input>
                </div>

                <div class="field input">
                    <label for="age">Age</label>
                    <input type="number" name="age" id="age" autocomplete="off" required></input>
                </div>
                <div class="field input">
                    <label for="password">Password</label>
                    <input type="password" name="password" id="password" autocomplete="off" required></input>
                </div>

                <div class="field">

                    <input type="submit" class="btn" name="submit" value="Register" required></input>
                </div>
                <div class="links">
                    Already a member? <a href="index.php">Sign In</a>
                </div>
            </form>
        </div>
      </div>
      </React.Fragment>
    )

}
export default Register;
